import React from "react";
import { useDispatch } from 'react-redux';
import './Refresh.css';

function Refresh() {
    const dispatch = useDispatch();

    return (
        <React.Fragment>
            <img alt="refresh" src="https://cdn-icons-png.flaticon.com/512/189/189792.png" className="refresh_btn" onClick={() => {
                dispatch({ type: 'CHANGE_LETTERDATA', data: [] });
            }}></img>
        </React.Fragment>
    );
};

export default Refresh;
